        <Form>
            <Form.Group as={Row}>
                <Form.Label column sm="2">Search</Form.Label>
                <Col sm="9">
                <Form.Control name="searchStr"
                value={str} 
                onChange={handleOnChange} 
                placeholder='Search..'>
                    
                </Form.Control>
                
                </Col>
            </Form.Group>
        </Form>
  
    </div>
  )
}
SearchForm.propTypes={
    handleOnChange:PropTypes.func,
    str:PropTypes.string

}
